import { Route } from "react-router-dom";
import Layout from "./components/Layout/Layout";
import AuthPage from "./pages/AuthPage";
import ProfilePage from "./pages/ProfilePage";

function App() {
  return (
    <Layout>
      <Route path='/auth'>
     <AuthPage/>
     </Route>
     <Route path='/profile'>
      <ProfilePage/>
     </Route>
    </Layout>
  );
}

export default App;
